import React, { useState } from "react";

const ContactSearch = ({ onSearch }) => {
  const [filters, setFilters] = useState({
    firstName: "",
    lastName: "",
    dob: "",
    email: "",
    phone: "",
    address: {
        city: "",
        streetAddress: "",
        state: "",
        zipcode: "",
    }
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFilters({ ...filters, [name]: value });
  };

  const handleSearch = () => {
    onSearch(filters);
  };

  return (
    <div className="form">
      <input name="firstName" placeholder="First Name" onChange={handleChange} />
      <input name="lastName" placeholder="Last Name" onChange={handleChange} />
      <input name="dob" type="date" placeholder="Date of Birth" onChange={handleChange} />
      <input name="email" placeholder="Email Address" onChange={handleChange} />
      <input name="phone" placeholder="Phone Number" onChange={handleChange} />
      <input name="streetAddress" placeholder="Street Address" onChange={handleChange} />
      <input name="phone" placeholder="Phone Number" onChange={handleChange} />
      <input name="city" placeholder="City" onChange={handleChange} />
      <input name="state" placeholder="State" onChange={handleChange} />
      <input name="zipcode" placeholder="Zipcode" onChange={handleChange} />
      <button onClick={handleSearch}>Search</button>
    </div>
  );
};

export default ContactSearch;
